Un relitto viene considerato quanto rimane di una nave dopo l'affondamento (naufragio) o l'arenamento a seguito di guasto, incidente o azione di guerra in mare. Esistono anche relitti spaziali costituiti da satelliti artificiali abbandonati e altri rottami in orbita intorno alla Terra, spesso catalogati come detriti spaziali o con l'equivalente inglese space debris. La terminologia comune, generalmente utilizzata tra chi si occupa di relitti, di navi sommerse e /o perdute è la seguente: Si intende per relitto aeronavale una nave o un mezzo aereo di cui si conosce con sicurezza la presenza sul fondale, pur non conoscendo con estrema sicurezza le coordinate della sua posizione.Nel caso di relitti navali, il nome da attribuire al relitto è il nome della nave al momento dell'affondamento e non quello al momento del varo.Un relitto navale pertanto può essere: 
*  1- conosciuto e localizzato; 
*  2- conosciuto e perduto; 
*  3- sconosciuto e localizzato; 
*  4- sconosciuto e perduto; Le navi di cui si ha invece notizia certa e documentata di affondamento e non sono state ancora ritrovate e localizzate vengono definite "navi sommerse o perdute".
